import React, {useContext} from "react";
import 'bootstrap/dist/css/bootstrap.css';
import { NavLink } from "react-router-dom";
import {NavDropdown, NavDropdownItem, NavDropdownDivider, NavDropdownHeader} from 'react-bootstrap';
import {UserContext} from "../App";

const Footer = () => {
    const RenderMenu = () => {
        return ( 
            <>
            <NavLink to="/" className="nav-item nav-link active">Home</NavLink>
            <NavLink to="/generate-token" className="nav-item nav-link">Generate Token</NavLink>
            <NavLink to="/profile" className="nav-item nav-link">Redeem Rewards</NavLink>
            <NavLink to="/track-status" className="nav-item nav-link">Track Status</NavLink>
            <NavLink to="/submit-feedback" className="nav-item nav-link">Feedback</NavLink>
            </>
          );
    }
    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container-fluid">
                    
                      
                <span>
    Made with <i class="fa fa-heart pulse"></i> in <a href="https://www.google.de/maps/place/Augsburger+Puppenkiste/@48.360357,10.903245,17z/data=!3m1!4b1!4m2!3m1!1s0x479e98006610a511:0x73ac6b9f80c4048f" target="_blank">Auxburg</a>
</span>
                </div>
            </nav>
        </div>
    );
}

export default Footer;
